select FirstName, LastName, Gender,Phone, CompanyName,CompanyId,ZipCode from [dbo].[person]
JOIN [dbo].[company]
ON person.CompanyId = company.CompanyIdd;

select FirstName, LastName, Gender,Phone, CompanyName , placename.place from [dbo].[fullcompany]
JOIN [dbo].[placename]
ON fullcompany.ZipCode = placename.postcode;
